eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"render\", function() { return render; });\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"staticRenderFns\", function() { return staticRenderFns; });\nvar render = function () {var _vm=this;var _h=_vm.$createElement;var _c=_vm._self._c||_h;return _c('VueRemarkRoot',[_c('RoboAcademyText',{attrs:{\"fWeight\":\"500\"}},[_vm._v(\"\\n  Introductionductionductionductionductionductionduction : \\\"L'histoire d'une fille nommée Trinity\\\"\\n\")]),_c('p',[_vm._v(\"La mythologie de la Grèce antique est divisée en deux cycles majeurs : la période où les dieux olympiens régnaient sur le monde des humains, et une période ultérieure où le chemin de vie des héros est prédéterminé par le destin, par exemple, Troie ou la légende d'Œdipe. Dans ma vie, tout d'abord, tout s'est déroulé selon le deuxième scénario - mon père m'a nommée Trinity à ma naissance, et à 20 ans j'ai suivi une sorte de lapin blanc.\")]),_c('LessonImages',{attrs:{\"imageClasses\":\"mb\",\"src\":\"escape-from-black-mirror/Olympus_Troy_The_Tales_of_Oedipus.png\",\"alt\":\"Olympus Troy The Tales of Oedipus\"}}),_c('p',[_vm._v(\"Le terrier de lapin m'a ramené à Megapolis, mais du point de vue du bus d'information de données. Là, dans les centres de données souterrains, j'ai trouvé des preuves de l'existence de dieux, similaires à ceux de la Grèce dans leur importance propre, leurs caprices et leurs désirs !\")]),_c('LessonImages',{attrs:{\"imageClasses\":\"mb\",\"src\":\"escape-from-black-mirror/Gods-datacenter.png\",\"alt\":\"Gods datacenter\"}}),_c('p',[_vm._v(\"Il y a plusieurs années, j'ai trouvé un point d'accès vulnérable complètement oublié à la voie principale de la ville. J'avais une porte vers un monde étrange de code de programme transparent, lisible et modifiable pour le protocole de communication de base de toute la Megacity. Un code de programme qui m'a conduit à intercepter des caméras, à contrôler les serrures de porte sans que les propriétaires le sachent, et même à maudire la gestion dynamique de la qualité de l'eau dans les robinets de cuisine des maisons individuelles. Après avoir vu tout cela, j'ai été rempli d'une terrible peur. Peur que tout cela se produise intentionnellement du point de vue des intérêts de quelqu'un d'autre dans ce monde. Je ne peux pas dire qu'il y a une grande silhouette maléfique derrière tous ces changements dans le code du protocole, mais au fil des ans d'observation en coulisses, j'en suis venu à la conclusion que des centaines de personnes aux intérêts différents ont un accès direct au cœur. Peu importe à quel point j'ai essayé de trouver au moins un de ces utilisateurs privilégiés, je me suis retrouvé seulement avec des preuves cryptographiques interceptées de l'exécution, mais pas de clé d'expéditeur, pas de traces qui pourraient me conduire à la vérité.\")]),_c('LessonImages',{attrs:{\"imageClasses\":\"mb\",\"src\":\"escape-from-black-mirror/hacking.png\",\"alt\":\"Gods hackers stayed in circle\"}}),_c('p',[_vm._v(\"Maintenant je suis un netrunner spécialisé dans la fourniture de cybersécurité et de confidentialité dans l'espace personnel d'un client. Je suis un spécialiste qui aidera à éviter le contrôle externe de votre maison, bureau ou voiture, même si le signal provient du cœur autonome de la Megapolis.\")]),_c('LessonImages',{attrs:{\"imageClasses\":\"mb\",\"src\":\"escape-from-black-mirror/Trinnity.png\",\"alt\":\"Trinity in underground datacenter\"}}),_c('p',[_vm._v(\"Pour solliciter mon aide, vous devez publier un contrat sur Satoshi Square, puis transférer de l'or numérique à l'adresse du contrat. Ensuite, soit moi, soit l'un des professionnels vérifiés, effectuera l'acte de coupure du double numérique du cloud de l'objet réel dans le monde physique. Entre nous, nous appelons cet acte de renaissance avec la coupure du cordon ombilical. Maintenant vous êtes une personne importante libre ! Vous n'avez pas à vous inquiéter que quelqu'un pirate votre démarrage à partir d'un enregistrement de la chambre où vous vous masturbez devant une photo de votre sœur tout en portant un masque en cuir. Vous pouvez discuter calmement de politique avec un ami de Californie, étant un membre du Congrès du Texas. Vous pouvez discuter de ce monde avec vos enfants non pas à partir d'un manuel scolaire et ne pas craindre que vos droits parentaux soient décidés.\")]),_c('p',[_vm._v(\"Vous souvenez-vous quand je vous ai dit que j'étais envahi par la peur après avoir réalisé tout cela ? Je pensais que le reste de ma vie était le théâtre de marionnettes de quelqu'un d'autre. Mais travailler en tant que netrunner m'a sauvé de la profonde dépression, bien que je n'aie jamais découvert la vérit sur ces étranges dieux terrestres. Au lieu de la dépression, j'ai décidé de me réjouir quand je peux aider quelqu'un d'influent, de riche, ou simplement soucieux de sa vie privée à éviter une implication involontaire dans une autre saison du drame de CyberDionysus.\")])],1)}\nvar staticRenderFns = []\n\n\n\n//# sourceURL=webpack:///./courses/fr/learn/escape-from-black-mirror/overview.md?./node_modules/cache-loader/dist/cjs.js?%7B%22cacheDirectory%22:%22node_modules/.cache/gridsome%22,%22cacheIdentifier%22:%223ec475f9-vue-loader-template%22%7D!./node_modules/gridsome/node_modules/vue-loader/lib/loaders/templateLoader.js??vue-loader-options!./node_modules/gridsome/node_modules/vue-loader/lib??ref--17-0!./node_modules/@gridsome/vue-remark/lib/loader.js??ref--17-1");

